import React from "react";
import product from "../../assets/images/banners/product.png";
import CartItem from "./CartItem.Component";

export default function Cart() {
  document.title = "Cart";
  return (
    <div className="main">
      <div className="container-fluid cart">
        <h1 className="title-intro">Giỏ Hàng Của Bạn</h1>
        <div className="row">
          <div className="col-sm-9 ">
          </div>
          <div className="col-sm-9">
            <CartItem />
            <CartItem />
            <CartItem />
            <CartItem />
          </div>
          <div
            className="col-sm-3"
          ></div>
        </div>
      </div>
    </div>
  );
}
